description:
I got a little addicted today downloading wallpapers, and I figured someone else might enjoy the fruits of my labors: ~2,500 HQ-HD wallpapers, ranging all kinds of subjects including space, nature, animals, cars, women, video games, movies and more. Some of these images are not HD, but I would estimate that 90%+ are ~720 or greater.

I had to zip the larger folders to get the torrent to upload (too many files apparently). I tried to only zip the big folders and zip them independently, so you can download a folder or 2 and see if you want the whole 1.6GB.

